var current = 0;
var previous = current;
let requestID = undefined;
let W = 500;
let H = 500;
let particlesArray = [];
let mappedImage = [];

const listOfImages = [
    ["data:image/png;base64,", 480, 640],
    ["data:image/png;base64,",418, 446],
    ["data:image/png;base64,", 1360, 999],
    ["data:image/png;base64,", 600, 600],
    ["data:image/png;base64,", 778, 989]
];
const collectionOfImages = [];

for (let i = 0; i < listOfImages.length; i++) {
    collectionOfImages.push(new Image());
    collectionOfImages[i].src = listOfImages[i][0];
}

const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');

//changing the opacity, you will change the accuracy of the drawn image.
var opacity = 0.2;
//the lower you go the more blurry the image will be drawn. The optimal values are : -1, 0, 1.
var particleSize = 1;
//give it a string with the name of the color to change the particles' color.
var particleColor = 'white';
//the optimal number of particles is <8000>, you can go with <5000> or higher, but it dicreases the performence.
const numberOfParticles = 10000;

function calculateRelativeBrightness(red, green, blue) {
    return Math.sqrt(
        (red * red) * 0.299 +
        (green * green) * 0.587 +
        (blue * blue) * 0.114
    )/100;
}

class Particle {
    constructor() {
        this.x = Math.random() * canvas.width;
        this.y = 0;
        this.speed = 0;
        this.velocity = Math.random() * 0.5;
        this.size = Math.random() * 1.5 + 1 - particleSize;
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);
    }
    update() {
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);

        if (this.position1 < 0) {this.position1 *= -1;}
        
        this.speed = mappedImage[this.position1][this.position2][0];
        let movement = (2.5 - this.speed) + this.velocity;
        
        this.y += movement;
        if (this.y >= canvas.height) {
            this.y = 0;
            this.x = Math.random() * canvas.width;
        }
    }
    draw() {
        ctx.beginPath();
        ctx.fillStyle = particleColor;
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
    }   
}

function constr(numberOfParticles) {
    for (let i = 0; i < numberOfParticles; i++) {
        particlesArray.push(new Particle);
    }
}

function destruct(numberOfParticles) {
    for (let i = 0; i < numberOfParticles; i++) {
        particlesArray.pop();
    }
}

function animate() {
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = '#000000';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particlesArray.length; i++) {
        particlesArray[i].update();
        ctx.globalAlpha = particlesArray[i].speed * opacity;
        particlesArray[i].draw();
    }
    requestID = requestAnimationFrame(animate);
}

function main(current) {

    canvas.width = listOfImages[current][1];
    canvas.height = listOfImages[current][2];

    ctx.drawImage(collectionOfImages[current], 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);

    ctx.clearRect(0, 0, canvas.width, canvas.height);

    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness, 
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    constr(numberOfParticles);
    animate();
}
main(current);

document.getElementById("right").addEventListener("click", function(){

    function change() {
        let pages = Number(document.getElementById("right").value);

        if (pages < 5) { 
            pages += 1;
        } else if (pages >= 5) {
            pages = 1;
        }

        document.getElementById("left").value = String(pages);
        document.getElementById("right").value = String(pages);
    }
    change();

    document.getElementById("number").innerHTML = String(document.getElementById("right").value) + "/5";
    update();
    document.getElementById("main").style.width = String(listOfImages[current][1]+120) + "px";
    document.getElementById("main").style.height = String(listOfImages[current][2]) + "px";
})

document.getElementById("left").addEventListener("click", function(){

    function change() {
        let pages = Number(document.getElementById("left").value);

        if (pages > 1) { 
            pages -= 1;
        } else if (pages = 1) {
            pages = 5;
        }

        document.getElementById("left").value = String(pages);
        document.getElementById("right").value = String(pages);
    }
    change();

    document.getElementById("number").innerHTML = String(document.getElementById("right").value) + "/5";
    update();
    document.getElementById("main").style.width = String(listOfImages[current][1]+120) + "px";
    document.getElementById("main").style.height = String(listOfImages[current][2]) + "px";
})

function update() {
    current = document.getElementById("left").value - 1;
    if (current != previous) {
        cancelAnimationFrame(requestID);
        particlesArray = [];
        mappedImage = [];
        main(current)
    }
    previous = current;
}
update()

